git diff &lt;base&gt;...HEAD
をエイリアス登録してます。「...」はmergeのために最適な共通祖先を見つけるオプションで、GitHub flowなら基本的にmasterに向かってPRするので「&lt;base&gt;」の部分に「origin/master」を入れておけばほぼ確実にPRと等価になります
